create table SandboxPrescription (
	Id INT PRIMARY KEY IDENTITY(1,1) NOT NULL,
	Date DATE,
	Patient VARCHAR(MAX),
	Diagnosis VARCHAR(MAX)
);
set identity_insert sandboxprescription on
set identity_insert sandboxprescription off
create table SandboxPrescriptionItem (
	Id INT PRIMARY KEY IDENTITY(1,1) NOT NULL,
	SandboxPrescriptionId INT,
	Item VARCHAR(MAX),
	IsAvailable BIT
);
set identity_insert sandboxprescriptionitem on
set identity_insert sandboxprescriptionitem off